import React from 'react'
import movies_requests from './movies_requests';
function App() {

  const func=async()=>{
    const response=await fetch(`https://api.themoviedb.org/3/${movies_requests.fetchRomanceMovies}`)
    const jsonresponse=response.json();
    console.log(jsonresponse);
  }
  func();
  return (
    <div>
      <h2>This is my netflix app</h2>
    </div>
  )
}

export default App
